import React from 'react';
import { BrowserRouter, Routes, Route, Link } from 'react-router-dom';
import StudentForm from './StudentForm';
import AddMarksForm from './AddMarksForm';
import HomePage from './HomePage';
import UpdateMarksForm from './UpdateMarksForm';
import GetStudentMarksForm from './GetStudentMarksForm';
import GetStudentGradeForm from './GetStudentGradeForm';

const App = () => {
  return (
    <BrowserRouter>
      <div className="app-container">
        <header className="header">
          <h1>Student Management System</h1>
        </header>
        <style>
          {`
          .nav-links {
            display: flex;
            flex-direction: column;
            list-style: none;
            margin: 0;
            padding: 0;
            background-color: #333;
            height: 100vh;
            width: 200px;
            position: fixed;
            top: 0;
            left: 0;
          }

          .nav-links li {
            padding: 10px;
          }

          .nav-links li a {
            color: #fff;
            text-decoration: none;
          }

          .nav-links li a:hover {
            text-decoration: underline;
          }

          .main-content {
            margin-left: 200px;
            padding: 20px;
          }

          .header {
            display: flex;
            justify-content: center;
            align-items: center;
            background-color: #333;
            color: #fff;
            padding: 20px;
          }
          `}
        </style>
        <nav class="bg-gray-800">
  <div class="container mx-auto px-4">
    <div class="flex items-center justify-between h-16">
      <div class="flex items-center">
        <a href="#" class="text-white font-semibold text-lg">Logo</a>
      </div>
      <div class="flex items-center">
        <a href="#" class="text-gray-300 hover:text-white px-3 py-2">Home</a>
        <a href="#" class="text-gray-300 hover:text-white px-3 py-2">About</a>
        <a href="#" class="text-gray-300 hover:text-white px-3 py-2">Services</a>
        <a href="#" class="text-gray-300 hover:text-white px-3 py-2">Contact</a>
      </div>
    </div>
  </div>
</nav>

        <main className="main-content">
          <Routes>
            <Route path="/" element={<HomePage />} />
            <Route path="/StudentForm" element={<StudentForm />} />
            <Route path="/AddMarksForm" element={<AddMarksForm />} />
            <Route path="/UpdateMarksForm" element={<UpdateMarksForm />} />
            <Route path="/GetStudentMarksForm" element={<GetStudentMarksForm />} />
            <Route path="/GetStudentGradeForm" element={<GetStudentGradeForm />} />
            {/* Add more routes for other components if needed */}
          </Routes>
        </main>
        <footer>
          {/* Add your footer content here */}
        </footer>
      </div>
    </BrowserRouter>
  );
};

export default App;
